import { Box } from "@mui/material";
import MyTypography from "../../../components/MyTypography";

const footer = () =>{
    return(
        <Box sx={{padding:"64px 64px"}}>
            <p>
                <MyTypography 
                    text="Powered by" 
                    size="18px"
                    letterSpacing="6px"
                    fontFamily="Raleway"
                    margin="10px 0"
                    fontWeight="400"
                    opacity="0.5"
                /> 
                <a href="https://www.w3schools.com/w3css/default.asp">W3.CSS</a>
            </p>
        </Box>
    );
}

export default footer;
